import './Header.css'
import React from 'react'
import { Link } from "react-router-dom";

function Header({ path = false }) {

    return (
        <>
        {
            !loggedIn ?

            <header className="header header_unlogged">
            <Link to="/" className="header__logo" />
            <div className="header__button-container">
              <Link to="/sign-up" className="header__button">Регистрация</Link>
              <Link to="/sign-in" className="header__button header__button_type_sign-in">Войти</Link>
            </div>
            </header>

            :

            <header className={path === "/" ? 'header header_logged-out' : 'header header_logged-in'}>


            </header>


        }





    </>
    )
}

export default Header;
